(clojure.core/defn stop-instances "Stops an Amazon EBS-backed instance.\n You can use the Stop action to hibernate an instance if the instance is enabled\nfor hibernation\n(https://docs.aws.amazon.com/AWSEC2/latest/UserGuide/Hibernate.html#enabling-hibernation)\nand it meets the hibernation prerequisites\n(https://docs.aws.amazon.com/AWSEC2/latest/UserGuide/Hibernate.html#hibernating-prerequisites).\nFor more information, see Hibernate Your Instance\n(https://docs.aws.amazon.com/AWSEC2/latest/UserGuide/Hibernate.html) in the\nAmazon Elastic Compute Cloud User Guide.\n We don't charge usage for a stopped instance, or data transfer fees; however,\nyour root partition Amazon EBS volume remains and continues to persist your\ndata, and you are charged for Amazon EBS volume usage. Every time you start your\nWindows instance, Amazon EC2 charges you for a full instance hour. If you stop\nand restart your Windows instance, a new instance hour begins and Amazon EC2\ncharges you for another full instance hour even if you are still within the same\n60-minute period when it was stopped. Every time you start your Linux instance,\nAmazon EC2 charges a one-minute minimum for instance usage, and thereafter\ncharges per second for instance usage.\n You can't start, stop, or hibernate Spot Instances, and you can't stop or\nhibernate instance store-backed instances. For information about using\nhibernation for Spot Instances, see Hibernating Interrupted Spot Instances\n(https://docs.aws.amazon.com/AWSEC2/latest/UserGuide/spot-interruptions.html#hibernate-spot-instances)\nin the Amazon Elastic Compute Cloud User Guide.\n When you stop or hibernate an instance, we shut it down. You can restart your\ninstance at any time. Before stopping or hibernating an instance, make sure it\nis in a state from which it can be restarted. Stopping an instance does not\npreserve data stored in RAM, but hibernating an instance does preserve data\nstored in RAM. If an instance cannot hibernate successfully, a normal shutdown\noccurs.\n Stopping and hibernating an instance is different to rebooting or terminating\nit. For example, when you stop or hibernate an instance, the root device and any\nother devices attached to the instance persist. When you terminate an instance,\nthe root device and any other devices attached during the instance launch are\nautomatically deleted. For more information about the differences between\nrebooting, stopping, hibernating, and terminating instances, see Instance\nLifecycle\n(https://docs.aws.amazon.com/AWSEC2/latest/UserGuide/ec2-instance-lifecycle.html)\nin the Amazon Elastic Compute Cloud User Guide.\n When you stop an instance, we attempt to shut it down forcibly after a short\nwhile. If your instance appears stuck in the stopping state after a period of\ntime, there may be an issue with the underlying host computer. For more\ninformation, see Troubleshooting Stopping Your Instance\n(https://docs.aws.amazon.com/AWSEC2/latest/UserGuide/TroubleshootingInstancesStopping.html)\nin the Amazon Elastic Compute Cloud User Guide." ([stop-instances-requestinput] (clojure.core/let [request-function-result__22119__auto__ (req-stop-instances-request stop-instances-requestinput)] (portkey.aws/-call-http (clojure.core/into request-function-result__22119__auto__ {:http.request.configuration/endpoints portkey.aws.ec2.-2016-11-15/endpoints, :http.request.configuration/target-prefix nil, :http.request.spec/output-spec :portkey.aws.ec2.-2016-11-15/stop-instances-result, :http.request.configuration/mime-type {"content-type" "application/x-www-form-urlencoded; charset=utf-8"}, :http.request.configuration/request-uri "/", :http.request.configuration/version "2016-11-15", :http.request.configuration/service-id "EC2", :http.request.spec/input-spec :portkey.aws.ec2.-2016-11-15/stop-instances-request, :http.request.configuration/protocol "ec2", :http.request.configuration/method :post, :http.request.configuration/response-code nil, :http.request.configurat